                <form>
                    <div>
                        <label>Email:</label>
                        <input type="text" 
                        placeholder="ejemplo@email.com"
                        value={this.state.email}></input> 
                    </div>
                    <div>
                    <label>password:</label>
                        <input type="password" 
                        placeholder="C@ntRaSeñ*a"
                        value={this.state.password}></input>
                    </div>
                </form>
            </div>
        );
    }
}

export default CrearUsuario;
